  `message` text DEFAULT NULL COMMENT '에러메시지',
  `is_checked` char(1) DEFAULT NULL COMMENT '개발자체크여부',
  `comment` text DEFAULT NULL COMMENT '에러관련메모',
  `request_method` varchar(10) DEFAULT NULL COMMENT '요청 method',
  `request_url` varchar(2000) DEFAULT NULL COMMENT '요청 URL',
  `request_body` varchar(2000) DEFAULT NULL COMMENT '요청 내용',
  `request_ip` varchar(15) DEFAULT NULL COMMENT '요청 IP',
  `reg_member_seq` int(11) DEFAULT NULL COMMENT '등록자회원일련번호',
  `reg_date` timestamp NULL DEFAULT current_timestamp() COMMENT '등록시간',
  PRIMARY KEY (`seq`)
) ENGINE=InnoDB AUTO_INCREMENT=1322 DEFAULT CHARSET=utf8mb4 COMMENT='에러로그';

