-- 프로시저 datacenter.spGetDivisionInfo 구조 내보내기
DELIMITER //
CREATE PROCEDURE `spGetDivisionInfo`()
BEGIN
	-- ==============================================================
	-- 명칭 : spGetDivisionInfo - Tree 구조 분류 조회하는 프로시져
	-- ==============================================================
	-- 사용처
	-- DivisionList.vue
	-- ==============================================================
	
	SELECT CASE WHEN TRIM(TRAILING ' > ' FROM CONCAT(CASE WHEN a.division_name IS NULL THEN '' ELSE CONCAT(a.division_name,' > ') END, 
														CASE WHEN b.division_name IS NULL THEN '' ELSE CONCAT(b.division_name,' > ') END, 
														CASE WHEN c.division_name IS NULL THEN '' ELSE CONCAT(c.division_name,' > ') END, 
														CASE WHEN d.division_name IS NULL THEN '' ELSE CONCAT(d.division_name,' > ') END, 
														CASE WHEN e.division_name IS NULL THEN '' ELSE CONCAT(e.division_name,' > ') END)) != '' THEN 
														TRIM(TRAILING ' > ' FROM CONCAT(CASE WHEN a.division_name IS NULL THEN '' ELSE CONCAT(a.division_name,' > ') END, 
														CASE WHEN b.division_name IS NULL THEN '' ELSE CONCAT(b.division_name,' > ') END, 
														CASE WHEN c.division_name IS NULL THEN '' ELSE CONCAT(c.division_name,' > ') END, 
														CASE WHEN d.division_name IS NULL THEN '' ELSE CONCAT(d.division_name,' > ') END, 
														CASE WHEN e.division_name IS NULL THEN '' ELSE CONCAT(e.division_name,' > ') END))
														ELSE f.division_name END
													AS parent_path, 
CASE WHEN TRIM(TRAILING '_' FROM CONCAT(CASE WHEN a.division_id IS NULL THEN '' ELSE CONCAT(a.division_id,'_') END, 
														CASE WHEN b.division_id IS NULL THEN '' ELSE CONCAT(b.division_id,'_') END, 
														CASE WHEN c.division_id IS NULL THEN '' ELSE CONCAT(c.division_id,'_') END, 
														CASE WHEN d.division_id IS NULL THEN '' ELSE CONCAT(d.division_id,'_') END, 
														CASE WHEN e.division_id IS NULL THEN '' ELSE CONCAT(e.division_id,'_') END)) != '' THEN 
														TRIM(TRAILING '_' FROM CONCAT(CASE WHEN a.division_name IS NULL THEN '' ELSE CONCAT(a.division_id,'_') END, 
														CASE WHEN b.division_id IS NULL THEN '' ELSE CONCAT(b.division_id,'_') END, 
														CASE WHEN c.division_id IS NULL THEN '' ELSE CONCAT(c.division_id,'_') END, 
														CASE WHEN d.division_id IS NULL THEN '' ELSE CONCAT(d.division_id,'_') END, 
														CASE WHEN e.division_id IS NULL THEN '' ELSE CONCAT(e.division_id,'_') END))
														ELSE f.division_id END
													AS parent_path_id, 													
	p.project_name, f.project_seq, f.seq, f.division_id, f.division_name, f.is_used, f.reg_date
	from mdc_division a
	right join mdc_division b
	    on a.seq = b.parent_division_seq
	right join mdc_division c
	    on b.seq = c.parent_division_seq
	right join mdc_division d
	    on c.seq = d.parent_division_seq
	right join mdc_division e
	    on d.seq = e.parent_division_seq
	right join mdc_division f
	    on e.seq = f.parent_division_seq
	JOIN mdc_project p 
		ON p.seq=f.project_seq
	ORDER BY project_seq, parent_path;
END//
DELIMITER ;

-- 프로시저 datacenter.spGetStatistics 구조 내보내기
DELIMITER //
CREATE PROCEDURE `spGetStatistics`(
	IN `iType` INT,
	IN `iProject_seq` VARCHAR(10),
	IN `iSearch_type` VARCHAR(10),
	IN `iStart_date` VARCHAR(10),
	IN `iEnd_date` VARCHAR(10),
	IN `iWorker` VARCHAR(10),
	IN `iStatus` CHAR(1)
)
BEGIN
	-- ============================================================================================================
	-- 명칭 : spGetStatistics - 통계 정보 조회 프로시져
	-- ============================================================================================================
	-- 사용처
	-- StatisticsWorker.vue
	-- StatisticsProject.vue
	-- Chart.vue
	-- ============================================================================================================
	-- Parameters 
	-- iType - 1: 라벨러통계, 2: 검수자통계, 3: 프로젝트통계(검수통합), 4: 프로젝트통계(검수별도)
	-- iProject_seq - 프로젝트 일련번호
	-- iSearch_type - 조회기준 - NOW: 기간조회/기간내완료된내역만, NOWW: 기간조회/기간내진행내역있으면, SUM: 기간무시-반려미적용, SUMC: 기간무시-반려적용
	-- iStart_date - 조회기간 시작일
	-- iEnd_date - 조회기간 종료일
	-- iWorker - 작업자 일련번호
	-- iStatus - 프로젝트상태 - 1: 진행중, 2: 중지중, 3: 종료
	-- ============================================================================================================
		
	SET @SQL = "";
	SET @projectSQL = "";	
	SET @regSQL = "";
	SET @jobSQL = "";
	SET @workerSQL = "";
	SET @addSQL = "";
	
	IF iProject_seq != '' THEN
		SET @projectSQL = CONCAT(" AND j.project_seq='", iProject_seq, "'");
	END IF;

	IF iStart_date != '' AND iEnd_date != '' AND INSTR(iSearch_type,'NOW') > 0 THEN
		SET @regSQL = CONCAT(" AND DATE_FORMAT(reg_date,'%Y-%m-%d') >= '", iStart_date, "' AND DATE_FORMAT(reg_date,'%Y-%m-%d') <= '", iEnd_date, "'");
		SET @jobSQL = CONCAT(" AND DATE_FORMAT(job_date,'%Y-%m-%d') >= '", iStart_date, "' AND DATE_FORMAT(job_date,'%Y-%m-%d') <= '", iEnd_date, "'");
	END IF;
	
	IF iWorker != '' THEN 
		SET @workerSQL = CONCAT(" AND labeler_member_seq='", iWorker, "'");
	END IF;
	
	IF iStatus != '' THEN
		SET @addSQL = CONCAT(" AND p.status='", iStatus, "'");
	END IF;
		
	IF iType = 1 THEN -- 라벨러 통계
		SET @SQL = "
		SELECT P.seq, P.project_name, m.user_name, m.seq as member_seq, IFNULL(j2.label_total,0) label_total_all, IFNULL(j2.label_total,0) - IFNULL(label_complete_all,0) AS label_ing";

		SET @SQL = CONCAT(@SQL, "
		, IFNULL(label_complete,0) - CASE WHEN '", iSearch_type, "' = 'SUMC' THEN IFNULL(label_reject,0) ELSE 0 END label_complete");
		
		SET @SQL = CONCAT(@SQL, "
			, IFNULL((SELECT SUM(label_cnt) FROM mdc_job WHERE project_seq = j2.project_seq AND labeler_member_seq = j2.labeler_member_seq", REPLACE(@regSQL,'reg_date','labeler_regdate'), " GROUP BY project_seq, labeler_member_seq),0) AS label_total
			, IFNULL(label_reject,0) label_reject			
			, IFNULL(label_complete_all,0) label_complete_all
			, IFNULL(check_ing_all,0) check_ing_all
			, IFNULL(check_ing,0) check_ing
			, IFNULL(check_complete_all,0) check_complete_all
			, IFNULL(check_complete,0) check_complete
			, IFNULL(check_reject,0) check_reject
			, CASE WHEN label_complete IS NULL OR label_complete = 0 THEN 0 ELSE TRIM(TRUNCATE((label_complete - CASE WHEN '", iSearch_type, "' = 'SUMC' THEN IFNULL(label_reject,0) ELSE 0 END) / label_total * 100.,2))+0 END  AS label_avgComplete 
			, CASE WHEN label_reject IS NULL OR label_reject = 0 THEN 0 ELSE TRIM(TRUNCATE(label_reject / label_total * 100.,2))+0 END AS label_avgReject
			, CASE WHEN check_complete IS NULL OR check_complete = 0  THEN 0 ELSE TRIM(TRUNCATE(check_complete / check_total * 100.,2))+0 END  AS check_avgComplete 
			FROM mdc_project P LEFT JOIN (SELECT project_seq, labeler_member_seq, SUM(label_cnt) label_total FROM mdc_job GROUP BY project_seq, labeler_member_seq) AS j2
			ON P.seq = j2.project_seq
			JOIN mdc_member m
			ON m.seq = j2.labeler_member_seq
			LEFT JOIN 
			(SELECT project_seq, job_member_seq, class_seq
				, SUM(case when job_status='A2' AND job_date IS NOT NULL THEN 1 ELSE 0 END) AS label_complete_all
				, SUM(case when job_status='A2' AND job_date IS NOT NULL ");
			
			SET @SQL = CONCAT(@SQL, @jobSQL, " THEN 1 ELSE 0 END) AS label_complete
				, SUM(case when (job_name='B' OR job_name='C' OR job_name='D') THEN 1 ELSE 0 END) AS check_total_all
				, SUM(case when (job_name='B' OR job_name='C' OR job_name='D') ");
			
			SET @SQL = CONCAT(@SQL, @regSQL, " THEN 1 ELSE 0 END) AS check_total
				, SUM(case when (job_status='B1' OR job_status='C1' OR job_status='D1') AND reg_date IS NOT NULL THEN 1 ELSE 0 END) AS check_ing_all
				, SUM(case when (job_status='B1' OR job_status='C1' OR job_status='D1') AND reg_date IS NOT NULL ");
			
			SET @SQL = CONCAT(@SQL, @regSQL, " THEN 1 ELSE 0 END) AS check_ing
				, SUM(case when (job_status='B2' OR job_status='C2' OR job_status='D2') AND job_date IS NOT NULL THEN 1 ELSE 0 END) AS check_complete_all
				, SUM(case when (job_status='B2' OR job_status='C2' OR job_status='D2') AND job_date IS NOT NULL ");
			
			SET @SQL = CONCAT(@SQL, @jobSQL, " THEN 1 ELSE 0 END) AS check_complete
				, SUM(case when (job_status='B5' OR job_status='C5' OR job_status='D5') AND job_date IS NOT NULL ");
			
			SET @SQL = CONCAT(@SQL, @jobSQL, " THEN 1 ELSE 0 END) AS check_reject
			FROM mdc_job_worker GROUP BY project_seq, job_member_seq) AS j1
			ON j2.project_seq = j1.project_seq AND j2.labeler_member_seq = j1.job_member_seq
			LEFT JOIN
			(SELECT project_seq, job_member_seq, class_seq
				, SUM(1) AS label_reject
			FROM mdc_job_worker WHERE job_name='A' AND seq IN (SELECT reject_seq FROM mdc_job_worker WHERE (job_status='B5' OR job_status='C5' OR job_status='D5')");
			
			SET @SQL = CONCAT(@SQL, @jobSQL, ")
			GROUP BY project_seq, job_member_seq
			) j3
			ON j2.project_seq = j3.project_seq AND j2.labeler_member_seq = j3.job_member_seq
			WHERE IFNULL(label_complete,0) > (CASE WHEN '", iSearch_type, "' = 'NOW' THEN 0 ELSE -1 END)");
			SET @SQL = CONCAT(@SQL, REPLACE(@projectSQL, 'j.','j2.'), @addSQL, @workerSQL, "
			GROUP BY P.seq, m.user_name
			ORDER BY P.seq, label_total_all DESC, label_complete DESC, label_ing DESC;");								
			
	END IF;
	
	IF iType = 2 THEN -- 검수자 통계
		SET @SQL = "
		SELECT P.seq, P.project_name, m.user_name, IFNULL(check_total_all,0) label_total, IFNULL(j2.label_total,0) - IFNULL(label_complete_all,0) AS label_ing
			, IFNULL(label_reject,0) label_reject
			, IFNULL(label_complete_all,0) label_complete_all
			, IFNULL(label_complete,0) label_complete
			, IFNULL(check_total_all,0) check_total_all
			, IFNULL(check_total,0) check_total
			, IFNULL(check_ing_all,0) check_ing_all
			, IFNULL(check_ing,0) check_ing
			, IFNULL(check_complete_all,0) check_complete_all
			, IFNULL(check_complete,0) check_complete
			, IFNULL(check_reject,0) check_reject";
		
		SET @SQL = CONCAT(@SQL, "
			, CASE WHEN label_complete IS NULL OR label_complete = 0 THEN 0 ELSE TRIM(TRUNCATE((label_complete - CASE WHEN '", iSearch_type, "' = 'SUMC' THEN IFNULL(label_reject,0) ELSE 0 END) / label_total * 100.,2))+0 END  AS label_avgComplete 
			, CASE WHEN label_reject IS NULL OR label_reject = 0 THEN 0 ELSE TRIM(TRUNCATE(label_reject / label_total * 100.,2))+0 END AS label_avgReject
			, CASE WHEN check_complete IS NULL OR check_complete = 0  THEN 0 ELSE TRIM(TRUNCATE(check_complete / check_total * 100.,2))+0 END  AS check_avgComplete 
			FROM mdc_project P
			LEFT JOIN 
			(SELECT project_seq, job_member_seq, class_seq
				, SUM(case when job_status='A2' AND job_date IS NOT NULL THEN 1 ELSE 0 END) AS label_complete_all
				, SUM(case when job_status='A2' AND job_date IS NOT NULL ");
			
			SET @SQL = CONCAT(@SQL, @jobSQL, " THEN 1 ELSE 0 END) AS label_complete
				, SUM(case when (job_name='B' OR job_name='C' OR job_name='D') THEN 1 ELSE 0 END) AS check_total_all
				, SUM(case when (job_name='B' OR job_name='C' OR job_name='D') ");
			
			SET @SQL = CONCAT(@SQL, @regSQL, " THEN 1 ELSE 0 END) AS check_total
				, SUM(case when (job_status='B1' OR job_status='C1' OR job_status='D1') ");
			
			SET @SQL = CONCAT(@SQL, @regSQL, " THEN 1 ELSE 0 END) AS check_ing_all
				, SUM(case when (job_status='B1' OR job_status='C1' OR job_status='D1') AND reg_date IS NOT NULL ");
			
			SET @SQL = CONCAT(@SQL, @regSQL, " THEN 1 ELSE 0 END) AS check_ing
				, SUM(case when (job_status='B2' OR job_status='C2' OR job_status='D2' OR job_status='B5' OR job_status='C5' OR job_status='D5') AND job_date IS NOT NULL THEN 1 ELSE 0 END) AS check_complete_all
				, SUM(case when (job_status='B2' OR job_status='C2' OR job_status='D2' OR job_status='B5' OR job_status='C5' OR job_status='D5') AND job_date IS NOT NULL ");
			
			SET @SQL = CONCAT(@SQL, @jobSQL, " THEN 1 ELSE 0 END) AS check_complete
				, SUM(case when (job_status='B5' OR job_status='C5' OR job_status='D5') AND job_date IS NOT NULL ");
			
			SET @SQL = CONCAT(@SQL, @jobSQL, " THEN 1 ELSE 0 END) AS check_reject
			FROM mdc_job_worker GROUP BY project_seq, job_member_seq) AS j1
			ON p.seq = j1.project_seq
			JOIN mdc_member m
			ON m.seq = j1.job_member_seq
			LEFT JOIN (SELECT project_seq, labeler_member_seq, SUM(label_cnt) label_total FROM mdc_job GROUP BY project_seq, labeler_member_seq) AS j2
			ON j1.project_seq = j2.project_seq AND j1.job_member_seq = j2.labeler_member_seq
			LEFT JOIN
			(SELECT project_seq, job_member_seq, class_seq
				, SUM(1) AS label_reject
			FROM mdc_job_worker WHERE job_name='A' AND seq IN (SELECT reject_seq FROM mdc_job_worker WHERE job_status='B5' OR job_status='C5' OR job_status='D5')
			GROUP BY project_seq, job_member_seq
			) j3
			ON j2.project_seq = j3.project_seq AND j2.labeler_member_seq = j3.job_member_seq
			WHERE check_total_all > 0 AND IFNULL(check_complete,0) > (CASE WHEN '", iSearch_type, "' = 'NOW' THEN 0 ELSE -1 END)");
			
			SET @SQL = CONCAT(@SQL, REPLACE(@projectSQL, 'j.project_seq','P.seq'), @addSQL, @workerSQL, "
			GROUP BY P.seq, m.user_name
			ORDER BY P.seq, label_total DESC, check_complete DESC, check_ing DESC;");			
						
	END IF;
		
	IF iType = 3 THEN -- 프로젝트 통계(통합검수)
		
		SET @SQL = "
		SELECT P.seq, P.project_name, IFNULL(j2.label_total,0) label_total_all, IFNULL(j2.label_total,0) - IFNULL(label_complete_all,0) AS label_ing
			, IFNULL(label_complete_all,0) label_complete_all ";
						
		SET @SQL = CONCAT(@SQL, "
			, IFNULL(label_complete,0) - CASE WHEN '", iSearch_type, "' = 'SUMC' THEN IFNULL(label_reject,0) ELSE 0 END label_complete");

		SET @SQL = CONCAT(@SQL, "
			, IFNULL((SELECT SUM(label_cnt) FROM mdc_job WHERE project_seq = j2.project_seq", REPLACE(@regSQL,'reg_date','labeler_regdate'), " GROUP BY project_seq),0) AS label_total
			, IFNULL(label_reject,0) label_reject
			, IFNULL(check_total_all,0) check_total_all
			, IFNULL(check_total,0) check_total
			, IFNULL(check_ing,0) check_ing
			, IFNULL(check_complete_all,0) check_complete_all
			, IFNULL(check_complete,0) check_complete
			, IFNULL(check_reject,0) check_reject
			, CASE WHEN label_complete IS NULL OR label_complete = 0 THEN 0 ELSE TRIM(TRUNCATE((label_complete - CASE WHEN '", iSearch_type, "' = 'SUMC' THEN IFNULL(label_reject,0) ELSE 0 END) / label_total * 100.,2))+0 END  AS label_avgComplete 
			, CASE WHEN label_reject IS NULL OR label_reject = 0 THEN 0 ELSE TRIM(TRUNCATE(label_reject / label_total * 100.,2))+0 END AS label_avgReject
			, CASE WHEN check_complete IS NULL OR check_complete = 0  THEN 0 ELSE TRIM(TRUNCATE(check_complete / check_total * 100.,2))+0 END AS check_avgComplete 
		FROM mdc_project P LEFT JOIN
		(SELECT project_seq, job_seq, class_seq
			, SUM(case when job_status='A2' AND job_date IS NOT NULL THEN 1 ELSE 0 END) AS label_complete_all
			, SUM(case when job_status='A2' AND job_date IS NOT NULL ");
		
		SET @SQL = CONCAT(@SQL, @jobSQL, " THEN 1 ELSE 0 END) AS label_complete
			, SUM(case when (job_status='B5' OR job_status='C5' OR job_status='D5') AND job_date IS NOT NULL ");
		SET @SQL = CONCAT(@SQL, @jobSQL, " THEN 1 ELSE 0 END) AS label_reject
			, SUM(case when job_name='B' OR job_name='C' OR job_name='D' THEN 1 ELSE 0 END) AS check_total_all
			, SUM(case when (job_name='B' OR job_name='C' OR job_name='D') ");
		SET @SQL = CONCAT(@SQL, @regSQL, " THEN 1 ELSE 0 END) AS check_total
			, SUM(case when (job_status='B1' OR job_status='C1' OR job_status='D1') AND reg_date IS NOT NULL ");
		SET @SQL = CONCAT(@SQL, @regSQL, " THEN 1 ELSE 0 END) AS check_ing");
		SET @SQL = CONCAT(@SQL, "
			, SUM(case when (job_status='B2' OR job_status='B5' OR job_status='C2' OR job_status='C5' OR job_status='D2' OR job_status='D5') AND job_date IS NOT NULL THEN 1 ELSE 0 END) AS check_complete_all");
		SET @SQL = CONCAT(@SQL, "
			, SUM(case when (job_status='B2' OR job_status='B5' OR job_status='C2' OR job_status='C5' OR job_status='D2' OR job_status='D5') AND job_date IS NOT NULL ");
		SET @SQL = CONCAT(@SQL, @jobSQL, " THEN 1 ELSE 0 END) AS check_complete");
		SET @SQL = CONCAT(@SQL, "
			, SUM(case when (job_status='B5' OR job_status='C5' OR job_status='D5') AND job_date IS NOT NULL ");
		SET @SQL = CONCAT(@SQL, @jobSQL, " THEN 1 ELSE 0 END) AS check_reject");
		
		SET @SQL = CONCAT(@SQL, "		
		FROM mdc_job_worker GROUP BY project_seq) AS j1
		ON P.seq = j1.project_seq
		LEFT JOIN (SELECT project_seq, SUM(label_cnt) label_total FROM mdc_job WHERE labeler_regdate IS NOT NULL ");
		
		-- REPLACE(@regSQL,'reg_date','labeler_regdate'), 
		SET @SQL = CONCAT(@SQL, " GROUP BY project_seq) AS j2
		ON P.seq = j2.project_seq
		WHERE P.seq > 0", REPLACE(@projectSQL, 'j.project_seq','P.seq'),";");
		
	END IF;
	
	IF iType = 4 THEN -- 프로젝트 통계(별도검수)
		SET @SQL = "
		SELECT P.seq, P.project_name, IFNULL(j2.label_total,0) label_total_all, IFNULL(j2.label_total,0) - IFNULL(label_complete_all,0) AS label_ing
			, IFNULL(label_complete_all,0) label_complete_all";

		SET @SQL = CONCAT(@SQL, "
			, IFNULL(label_complete,0) - CASE WHEN '", iSearch_type, "' = 'SUMC' THEN IFNULL(label_reject,0) ELSE 0 END label_complete");

		SET @SQL = CONCAT(@SQL, "
			, IFNULL((SELECT SUM(label_cnt) FROM mdc_job WHERE project_seq = j2.project_seq", REPLACE(@regSQL,'reg_date','labeler_regdate'), " GROUP BY project_seq),0) AS label_total
			, IFNULL(label_reject,0) label_reject
			, IFNULL(check1_total,0) check1_total
			, IFNULL(check1_ing,0) check1_ing
			, IFNULL(check1_complete_all,0) check1_complete_all
			, IFNULL(check1_complete,0) check1_complete
			, IFNULL(check1_reject,0) check1_reject
			, IFNULL(check2_total,0) check2_total
			, IFNULL(check2_ing,0) check2_ing
			, IFNULL(check2_complete_all,0) check2_complete_all
			, IFNULL(check2_complete,0) check2_complete
			, IFNULL(check2_reject,0) check2_reject
			, IFNULL(check3_total,0) check3_total
			, IFNULL(check3_ing,0) check3_ing
			, IFNULL(check3_complete_all,0) check3_complete_all
			, IFNULL(check3_complete,0) check3_complete
			, IFNULL(check3_reject,0) check3_reject
			, CASE WHEN label_complete IS NULL OR label_complete = 0 THEN 0 ELSE TRIM(TRUNCATE((label_complete - CASE WHEN '", iSearch_type, "' = 'SUMC' THEN IFNULL(label_reject,0) ELSE 0 END) / label_total * 100.,2))+0 END  AS label_avgComplete 
			, CASE WHEN label_reject IS NULL OR label_reject = 0 THEN 0 ELSE TRIM(TRUNCATE(label_reject / label_total * 100.,2))+0 END AS label_avgReject
			, CASE WHEN check1_complete IS NULL OR check1_complete = 0  THEN 0 ELSE TRIM(TRUNCATE(check1_complete / check1_total * 100.,2))+0 END AS check1_avgComplete 
			, CASE WHEN check2_complete IS NULL OR check2_complete = 0  THEN 0 ELSE TRIM(TRUNCATE(check2_complete / check2_total * 100.,2))+0 END AS check2_avgComplete 
			, CASE WHEN check3_complete IS NULL OR check3_complete = 0  THEN 0 ELSE TRIM(TRUNCATE(check3_complete / check3_total * 100.,2))+0 END AS check3_avgComplete 
		FROM mdc_project P LEFT JOIN
		(SELECT project_seq, job_seq, class_seq
			, SUM(case when job_status='A2' AND job_date IS NOT NULL THEN 1 ELSE 0 END) AS label_complete_all
			, SUM(case when job_status='A2' AND job_date IS NOT NULL ");
			
		SET @SQL = CONCAT(@SQL, @jobSQL, " THEN 1 ELSE 0 END) AS label_complete
			, SUM(case when (job_status='B5' OR job_status='C5' OR job_status='D5') AND job_date IS NOT NULL ");
		SET @SQL = CONCAT(@SQL, @jobSQL, " THEN 1 ELSE 0 END) AS label_reject
			, SUM(case when job_name='B' THEN 1 ELSE 0 END) AS check1_total_all
			, SUM(case when job_name='B' ");
		SET @SQL = CONCAT(@SQL, @regSQL, " THEN 1 ELSE 0 END) AS check1_total
			, SUM(case when job_status='B1' AND reg_date IS NOT NULL ");
		SET @SQL = CONCAT(@SQL, @regSQL, " THEN 1 ELSE 0 END) AS check1_ing");
		SET @SQL = CONCAT(@SQL, "
			, SUM(case when (job_status='B2' OR job_status='B5') AND job_date IS NOT NULL THEN 1 ELSE 0 END) AS check1_complete_all");
		SET @SQL = CONCAT(@SQL, "
			, SUM(case when (job_status='B2' OR job_status='B5') AND job_date IS NOT NULL ");
		SET @SQL = CONCAT(@SQL, @jobSQL, " THEN 1 ELSE 0 END) AS check1_complete");
		SET @SQL = CONCAT(@SQL, "
			, SUM(case when job_status='B5' AND job_date IS NOT NULL ");
		SET @SQL = CONCAT(@SQL, @jobSQL, " THEN 1 ELSE 0 END) AS check1_reject");
		SET @SQL = CONCAT(@SQL, "
			, SUM(case when job_name='C' THEN 1 ELSE 0 END) AS check2_total_all
			, SUM(case when job_name='C' ");
		SET @SQL = CONCAT(@SQL, @regSQL, " THEN 1 ELSE 0 END) AS check2_total
			, SUM(case when job_status='C1' AND reg_date IS NOT NULL ");
		SET @SQL = CONCAT(@SQL, @regSQL, " THEN 1 ELSE 0 END) AS check2_ing");
		SET @SQL = CONCAT(@SQL, "
			, SUM(case when (job_status='C2' OR job_status='C5') AND job_date IS NOT NULL THEN 1 ELSE 0 END) AS check2_complete_all");
		SET @SQL = CONCAT(@SQL, "
			, SUM(case when job_status='C2' AND job_date IS NOT NULL ");
		SET @SQL = CONCAT(@SQL, @jobSQL, " THEN 1 ELSE 0 END) AS check2_complete");
		SET @SQL = CONCAT(@SQL, "
			, SUM(case when job_status='C5' AND job_date IS NOT NULL ");
		SET @SQL = CONCAT(@SQL, @jobSQL, " THEN 1 ELSE 0 END) AS check2_reject");
		SET @SQL = CONCAT(@SQL, "
			, SUM(case when job_name='D' THEN 1 ELSE 0 END) AS check3_total_all
			, SUM(case when job_name='D' ");
		SET @SQL = CONCAT(@SQL, @regSQL, " THEN 1 ELSE 0 END) AS check3_total
			, SUM(case when job_status='D1' AND reg_date IS NOT NULL ");
		SET @SQL = CONCAT(@SQL, @regSQL, " THEN 1 ELSE 0 END) AS check3_ing");
		SET @SQL = CONCAT(@SQL, "
			, SUM(case when (job_status='D2' OR job_status='D5') AND job_date IS NOT NULL THEN 1 ELSE 0 END) AS check3_complete_all");
		SET @SQL = CONCAT(@SQL, "
			, SUM(case when job_status='D2' AND job_date IS NOT NULL ");
		SET @SQL = CONCAT(@SQL, @jobSQL, " THEN 1 ELSE 0 END) AS check3_complete");
		SET @SQL = CONCAT(@SQL, "
			, SUM(case when job_status='D5' AND job_date IS NOT NULL ");
		SET @SQL = CONCAT(@SQL, @jobSQL, " THEN 1 ELSE 0 END) AS check3_reject");
		
		SET @SQL = CONCAT(@SQL, "		
		FROM mdc_job_worker GROUP BY project_seq) AS j1
		ON P.seq = j1.project_seq
		LEFT JOIN (SELECT project_seq, SUM(label_cnt) label_total FROM mdc_job WHERE labeler_regdate IS NOT NULL ");
		
		-- REPLACE(@regSQL,'reg_date','labeler_regdate'), 
		SET @SQL = CONCAT(@SQL, " GROUP BY project_seq) AS j2
		ON P.seq = j2.project_seq
		WHERE P.seq > 0", REPLACE(@projectSQL, 'j.project_seq','P.seq'),";");
				
	END IF;
	
	PREPARE stmt1 FROM @SQL;
	EXECUTE stmt1;
	DEALLOCATE PREPARE stmt1; 	
	

	-- SELECT @SQL;

END//
DELIMITER ;

-- 프로시저 datacenter.spGetWorker 구조 내보내기
DELIMITER //
CREATE PROCEDURE `spGetWorker`(
	IN `iProject_seq` VARCHAR(10),
	IN `iStart_date` VARCHAR(10),
	IN `iEnd_date` VARCHAR(10)
)
BEGIN
	-- =======================================================
	-- 명칭 : spGetWorker - Dashboard 작업자 요약 프로시져
	-- =======================================================
	-- 사용처
	-- Dashboard.vuedatacenter
	-- =======================================================
	-- Parameters
	-- iProject_seq - 프로젝트 일련번호
	-- iStart_date - 조회기간 시작일
	-- iEnd_date - 조회기간 종료일
	-- =======================================================
	
	SET @SQL = "";
	SET @projectSQL = "";
	SET @regSQL = "";
	SET @jobSQL = "";
	SET @rejectSQL = "";

	IF iProject_seq != '' THEN
		SET @projectSQL = CONCAT(" AND project_seq='", iProject_seq, "'");
	END IF;

	IF iStart_date != '' AND iEnd_date != '' THEN
		SET @regSQL = CONCAT(" AND DATE_FORMAT(reg_date,'%Y-%m-%d') >= '", iStart_date, "' AND DATE_FORMAT(reg_date,'%Y-%m-%d') <= '", iEnd_date, "'");
		SET @jobSQL = CONCAT(" AND DATE_FORMAT(job_date,'%Y-%m-%d') >= '", iStart_date, "' AND DATE_FORMAT(job_date,'%Y-%m-%d') <= '", iEnd_date, "'");
		SET @rejectSQL = CONCAT(" AND DATE_FORMAT(reject_date,'%Y-%m-%d') >= '", iStart_date, "' AND DATE_FORMAT(reject_date,'%Y-%m-%d') <= '", iEnd_date, "'");
	END IF;
	
	SET @SQL = "
		SELECT COUNT(seq) AS total
		, (SELECT COUNT(*) FROM mdc_member WHERE (
				seq NOT IN(
					SELECT DISTINCT job_member_seq FROM mdc_job_worker WHERE job_date IS NULL";

	SET @SQL = CONCAT(@SQL, @projectSQL, "
					UNION  
					SELECT DISTINCT labeler_member_seq FROM mdc_job WHERE labeler_jobdate IS NULL", @projectSQL, "
				)
			)) AS not_work	
		, (SELECT COUNT(*) FROM mdc_member WHERE (
				seq IN(
					SELECT DISTINCT job_member_seq FROM mdc_job_worker WHERE job_date IS NULL AND job_name='A'",@projectSQL, "
					UNION  
					SELECT DISTINCT labeler_member_seq FROM mdc_job WHERE labeler_jobdate IS NULL", @projectSQL, "
				)
			)) AS labeler	-- 작업완료된 라벨러는 제외
		, (SELECT COUNT(*) FROM mdc_member WHERE (
				seq IN(
					SELECT DISTINCT job_member_seq FROM mdc_job_worker WHERE job_date IS NULL AND (job_name='B' OR job_name='C' OR job_name='D')", @projectSQL,"
				)
			)) AS checker	-- 작업완료된 검수자는 제외
		FROM mdc_member");	
	-- SELECT @SQL;			
	
	PREPARE stmt1 FROM @SQL;
	EXECUTE stmt1;
	DEALLOCATE PREPARE stmt1; 	
	

END//
DELIMITER ;

